description:
Verenigde Staten
Fantasy / Avontuur
130 minuten

een mooie film

met Charlie Cox, Claire Danes en Robert De Niro

Het verhaal over de jongen Tristan, die het hart van zijn geliefde Victoria wil winnen. Hiervoor gaat hij op zoek naar een 
vallende ster genaamd Yvaine, die hem naar een magische wereld leidt. Hier moet hij het opnemen tegen de boosaardige heks Lamia 
en de piraat Captain Shakespeare.
